import{_ as e,o as i,c as t,a}from"./app.57a3dbd1.js";const v=JSON.parse('{"title":"Test suite","description":"","frontmatter":{"contributors":["ZhouYixun"]},"headers":[{"level":2,"title":"Device Coverage and Use Case Coverage","slug":"device-coverage-and-use-case-coverage","link":"#device-coverage-and-use-case-coverage","children":[]},{"level":2,"title":"Use case configuration","slug":"use-case-configuration","link":"#use-case-configuration","children":[]},{"level":2,"title":"Device Configuration","slug":"device-configuration","link":"#device-configuration","children":[]},{"level":2,"title":"Performance collection","slug":"performance-collection","link":"#performance-collection","children":[{"level":3,"title":"iOS","slug":"ios","link":"#ios","children":[]},{"level":3,"title":"android","slug":"android","link":"#android","children":[]}]},{"level":2,"title":"Robot Notifications","slug":"robot-notifications","link":"#robot-notifications","children":[]}],"relativePath":"en/doc/doc-suite.md","lastUpdated":1716537034000}'),o={name:"en/doc/doc-suite.md"},s=a('<h1 id="test-suite" tabindex="-1">Test suite <a class="header-anchor" href="#test-suite" aria-hidden="true">#</a></h1><p>This page is a tutorial on configuring a test suite.</p><h2 id="device-coverage-and-use-case-coverage" tabindex="-1">Device Coverage and Use Case Coverage <a class="header-anchor" href="#device-coverage-and-use-case-coverage" aria-hidden="true">#</a></h2><p>Use case coverage means that only one device is assigned to each use case, and device coverage means that each device will execute all use cases.</p><p>Example: Use case A and use case B are selected, and equipment 1, equipment 2, and equipment 3 are selected.</p><p>Use case coverage --&gt; A random device runs use case A and use case B, and runs a total of 2 times.</p><p>Device Coverage --&gt; Both use cases were run for all devices, a total of 6 runs.</p><h2 id="use-case-configuration" tabindex="-1">Use case configuration <a class="header-anchor" href="#use-case-configuration" aria-hidden="true">#</a></h2><p>Select the use case you need to run in the use case list, and then drag and drop the order in the list, and the test will be performed in this order during runtime.</p><div class="warning custom-block"><p class="custom-block-title">note</p><p>When a test case in the list is deleted on the test case page, it will be automatically removed from the list.</p></div><h2 id="device-configuration" tabindex="-1">Device Configuration <a class="header-anchor" href="#device-configuration" aria-hidden="true">#</a></h2><p>Select the device to run.</p><div class="tip custom-block"><p class="custom-block-title">triggers the control runtime</p><ol><li>When no device is idle, the suite skips execution</li><li>When the use case list is empty, the suite skips execution</li><li>When the device list is empty, the suite skips execution</li></ol></div><h2 id="performance-collection" tabindex="-1">Performance collection <a class="header-anchor" href="#performance-collection" aria-hidden="true">#</a></h2><p>Set the switch and interval of performance collection.</p><h3 id="ios" tabindex="-1">iOS <a class="header-anchor" href="#ios" aria-hidden="true">#</a></h3><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This feature is only available after v2.1.0</p></div><p>iOS uses <a href="https://sonic-cloud.cn/sib/sib-perf.html" target="_blank" rel="noreferrer">sib perfmon</a> for performance collection.</p><h3 id="android" tabindex="-1">android <a class="header-anchor" href="#android" aria-hidden="true">#</a></h3><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>This feature is only available after v2.2.0</p></div><p>Android uses <a href="https://sonic-cloud.cn/sas/re-sas.html" target="_blank" rel="noreferrer">sas perfmon</a> for performance collection.</p><h2 id="robot-notifications" tabindex="-1">Robot Notifications <a class="header-anchor" href="#robot-notifications" aria-hidden="true">#</a></h2><p>When the project has been configured to notify the robot, the execution result of the suite will be notified by the robot.</p>',23),c=[s];function n(r,l,d,h,u,p){return i(),t("div",null,c)}const g=e(o,[["render",n]]);export{v as __pageData,g as default};
